/****** Object:  UserDefinedFunction [dbo].[LoanDueDate]    Script Date: 2021. 08. 18. 15:16:09 ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO



	CREATE   FUNCTION [dbo].[LoanDueDate] (@Date date,@Day tinyint) RETURNS date AS
		BEGIN
			DECLARE @D date
			
			SET @D = DATEADD(day, @Day, @Date)
			RETURN @D
		END
