/****** Object:  View [dbo].[vReader]    Script Date: 2021. 08. 18. 15:16:09 ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
	CREATE   VIEW [dbo].[vReader] AS
	SELECT B.BookID,A.AuthorName,B.Title,P.PublisherName,B.PublishingYear,D.DepartementName,F.FacultyName,B.OnlyForReadingroom
	FROM Author A inner join BookAuthor BA on A.AuthorID=BA.AuthorID
	inner join Book B on BA.BookID=B.BookID inner join Publisher P on B.PublisherID=P.PublisherID
	inner join Departement D on B.DepartementCode=D.DepartementCode
	inner join Faculty F on D.FacultyCode=F.FacultyCode
	
GO
