/****** Object:  View [dbo].[vPrenotatedBookAvailable]    Script Date: 2021. 08. 18. 15:16:10 ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
	CREATE   VIEW [dbo].[vPrenotatedBookAvailable] AS
	SELECT P.BookID,B.Title,P.MemberID,M.LastName+' '+M.FirstName MemberName
	FROM LoanHistory LH left join Loan L on LH.BookID=L.BookID and LH.MemberID=L.MemberID
	inner join Prenotation P on LH.BookID=P.BookID and LH.MemberID=P.MemberID 
	inner join Book B on P.BookID=B.BookID inner join Member M on P.MemberID=M.MemberID
	where L.BookID is null and L.MemberID is null
	
GO
