/****** Object:  View [dbo].[vStatistics]    Script Date: 2021. 08. 18. 15:16:10 ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
	CREATE   VIEW [dbo].[vStatistics] AS
	SELECT F.FacultyName, D.DepartementName,count(1) NumberOfBooks,count(L.MemberID) BooksLoaned
	FROM Book B inner join 	Departement D on B.DepartementCode=D.DepartementCode
	inner join Faculty F on D.FacultyCode=F.FacultyCode left join Loan L on B.BookID=L.BookID
	group by F.FacultyName, D.DepartementName
	
GO
