/****** Object:  View [dbo].[Numbers]    Script Date: 2021. 08. 18. 15:16:10 ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
	CREATE   VIEW [dbo].[Numbers] AS
	WITH
		Pass0 AS (SELECT 1 C UNION ALL SELECT 1), --2 rows
		Pass1 AS (SELECT 1 C FROM Pass0 A CROSS JOIN Pass0 B),--4 rows
		Pass2 AS (SELECT 1 C FROM Pass1 A CROSS JOIN Pass1 B),--16 rows
		Pass3 AS (SELECT 1 C FROM Pass2 A CROSS JOIN Pass2 B),--256 rows
		Pass4 AS (SELECT 1 C FROM Pass3 A CROSS JOIN Pass3 B), -- 65536 rows
		Pass5 AS (SELECT 1 C FROM Pass4 A CROSS JOIN Pass2 B), -- 65536 rows
		T AS (SELECT 'Mathematics'+cast(ROW_NUMBER() OVER(ORDER BY C) as varchar(30)) Number FROM Pass5)
			SELECT Number FROM T
GO
