-- 
	CREATE   PROCEDURE [dbo].[DataReading]
		
          @FilePath varchar(50)=null,
		  @FT varchar(5)=null,
		  @RT varchar(5)=null

		  AS
        IF 
	@FilePath is null or @FT is null or @RT is null
		return 1   
	
ELSE
BULK INSERT dbo.Member
		FROM '@FilePath'
		WITH (FIELDTERMINATOR ='@FT',  ROWTERMINATOR ='@RT')
GO
/****** Object:  StoredProcedure [dbo].[InsertDeleteUpdateLoan]    Script Date: 2021. 08. 18. 15:16:11 ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
-- 
	CREATE   PROCEDURE [dbo].[InsertDeleteUpdateLoan]
		
           @Action tinyint=1,
		   @MemberID int =null,
           @BookID int =null,
		   @LoanDate date =null
          
	AS

	IF @Action =1 
	BEGIN
	IF 
	@MemberID is null or @BookID is null or @LoanDate is null
		return 1 
		
	ELSE IF exists (select 1 from [dbo].[Loan] where BookID =@BookID) 
		
		return 2 
    	
	ELSE IF 
	(select COUNT(1) from [dbo].[Loan] where MemberID =@MemberID )=3
	
	return 3

	
	ELSE IF exists (select 1 from [dbo].[Upkeeping] where BookID =@BookID)
	return 4

	ELSE IF  (select B.OnlyForReadingroom from [dbo].[Book] B where BookID =@BookID)=1
	return 5

	ELSE IF exists (select 1 from [dbo].[Loan] where MemberID = @MemberID and DueDate<GETDATE())
	return 6

	ELSE IF exists (select 1 from [dbo].[Prenotation] where BookID = @BookID and MemberID != @MemberID) 
		
		return 7
	ELSE IF @LoanDate  <> cast(getdate() as date) 
		
		return 8

	ELSE IF not exists (select 1 from [dbo].[Book] where BookID =@BookID) 
		
		return 9

	ELSE IF not exists (select 1 from [dbo].[Member] where MemberID =@MemberID) 
		
		return 10
	ELSE IF
	(select cast(StartDate as date)
from
(SELECT MemberID,BookID,StartDate,EndDate,ROW_NUMBER() OVER(PARTITION BY MemberID,BookID ORDER BY EndDate ) RowNUMBER
	FROM LoanHistory LH) X
	where X.RowNUMBER=1 and MemberID=@MemberID and BookID=@BookID)=
	(select cast(EndDate as date)
from
(SELECT MemberID,BookID,StartDate,EndDate,ROW_NUMBER() OVER(PARTITION BY MemberID,BookID ORDER BY EndDate ) RowNUMBER
	FROM LoanHistory LH) X
	where X.RowNUMBER=2 and MemberID=@MemberID and BookID=@BookID) and
(select cast(EndDate as date)
from
(SELECT MemberID,BookID,StartDate,EndDate,ROW_NUMBER() OVER(PARTITION BY MemberID,BookID ORDER BY EndDate ) RowNUMBER
	FROM LoanHistory LH) X
	where X.RowNUMBER=1 and MemberID=@MemberID and BookID=@BookID)=cast(GETDATE() as date)
	return 11

	ELSE

INSERT INTO [dbo].[Loan]
           ([MemberID]
           ,[BookID]
           ,[LoanDate]
           ,[DueDate])
     VALUES
           (@MemberID
           ,@BookID
           ,@LoanDate
           ,dbo.LoanDueDate (@LoanDate,21))
		   END
ELSE IF @Action =2
BEGIN
IF 
	@MemberID is null or @BookID is null
	return 1

	

	ELSE 
	DELETE FROM [dbo].[Loan]
      WHERE MemberID =@MemberID and BookID =@BookID
END
ELSE IF @Action =3
BEGIN
IF 
	@MemberID is null or @BookID is null 
		return 1 

		ELSE IF exists (select 1 from [dbo].[Loan] where MemberID = @MemberID and DueDate<GETDATE())
	return 6

	ELSE IF
	(select cast(StartDate as date)
from
(SELECT MemberID,BookID,StartDate,EndDate,ROW_NUMBER() OVER(PARTITION BY MemberID,BookID ORDER BY EndDate ) RowNUMBER
	FROM LoanHistory LH) X
	where X.RowNUMBER=1 and MemberID=@MemberID and BookID=@BookID)=
	(select cast(EndDate as date)
from
(SELECT MemberID,BookID,StartDate,EndDate,ROW_NUMBER() OVER(PARTITION BY MemberID,BookID ORDER BY EndDate ) RowNUMBER
	FROM LoanHistory LH) X
	where X.RowNUMBER=2 and MemberID=@MemberID and BookID=@BookID) and
(select cast(EndDate as date)
from
(SELECT MemberID,BookID,StartDate,EndDate,ROW_NUMBER() OVER(PARTITION BY MemberID,BookID ORDER BY EndDate ) RowNUMBER
	FROM LoanHistory LH) X
	where X.RowNUMBER=1 and MemberID=@MemberID and BookID=@BookID)=cast(GETDATE() as date)
	return 11

		ELSE
		UPDATE [dbo].[Loan]
   SET 
      [DueDate] = dbo.LoanDueDate (LoanDate,28)
 WHERE MemberID =@MemberID and BookID =@BookID
END
GO
