	@MemberID is null or @BookID is null or @PrenotationDate is null
		return 1 
		
	
	ELSE IF not exists (select 1 from [dbo].[Book] where BookID =@BookID) 
		
		return 2

	ELSE IF not exists (select 1 from [dbo].[Member] where MemberID =@MemberID) 
		
		return 3

	ELSE IF @PrenotationDate  <> cast(getdate() as date) 
		
		return 4

	ELSE IF  (select B.OnlyForReadingroom from [dbo].[Book] B where BookID =@BookID)=1
	return 5

	ELSE IF exists (select 1 from [dbo].[Loan] where MemberID = @MemberID and DueDate<GETDATE())
	return 6

	ELSE IF exists (select 1 from [dbo].[Loan] where BookID =@BookID and MemberID =@MemberID) 
		
		return 7

	ELSE
INSERT INTO [dbo].[Prenotation]
           ([MemberID]
           ,[BookID]
           ,[PrenotationDate])
     VALUES
           (@MemberID ,
           @BookID ,
		   @PrenotationDate )

